  render() {
    return (
      <article>
        <h2>Create</h2>
        <form>
          <p>
            <input type="text" name="title" placeholder="title" />
          </p>
          <p>
            {" "}
            <textarea type="text" name="title" placeholder="description" />
          </p>

          <input type="button" placeholder="submit"></input>
        </form>
      </article>
    );
  }
}

export default CreateContent;
